import React, { useEffect } from 'react';
import { CaseStudyHero } from '../components/CaseStudyHero';
import { CaseStudyParagraph } from '../components/CaseStudyParagraph';
import { getImagePath } from '../utils/imageUtils';
import './CodingCompany.css';

const CodingCompany = () => {
  useEffect(() => {
    window.scrollTo(0, 0);
  }, []);

  return (
    <div className="case-study-coding-company">
      <div className="container">
        <CaseStudyHero
          title="Coding Company"
          subtitle="Pushing the boundaries and building with pride."
          services={['Branding', 'UI/UX Design']}
          client="Coding Company"
          year="2022"
        />

        <div className="work-in-progress-banner">
          <p>This case study is a work in progress and will be available soon.</p>
        </div>

        <CaseStudyParagraph
          title="Project Overview"
          content={[
            "Coding Company approached us to develop a brand identity that would reflect their innovative approach to software development and position them as a leader in the tech industry.",
            "This case study will detail our branding process, including research, concept development, and the final brand guidelines."
          ]}
        />

        {/* Placeholder for future content */}
        <div className="placeholder-image">
          <img src={getImagePath('coding_company_placeholder.png')} alt="Coding Company Branding Placeholder" />
        </div>

      </div>
    </div>
  );
};

export default CodingCompany;
